using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using WebSocketSharp;
using WebSocketSharp.Server;

namespace BookieServ
{
  public class BookieService : WebSocketBehavior
  {
    private readonly Dictionary<string, int> _dice = new Dictionary<string, int>();
    private readonly Dictionary<string, string> _roomData = new Dictionary<string, string>();
    private readonly CryptoRandom _random = new CryptoRandom();

    public BookieService() : base()
    {
      _roomData.Add("72555667",
        "");
      _roomData.Add("72546962",
        "");
    }

    protected override void OnOpen()
    {
      foreach (var item in _dice)
        Send($"update:{item.Key}:{item.Value}");

      Console.WriteLine($"Connected {ID}");
      base.OnOpen();
    }

    protected override void OnMessage(MessageEventArgs e)
    {
      if (!e.Data.Contains(":")) return;

      var parameters = e.Data.Split(':');
      switch (parameters[0])
      {
        case "roll":
          if (!_dice.ContainsKey(parameters[1])) _dice.Add(parameters[1], 0);
          RollDice(parameters[1]);
          Console.WriteLine($"[{ID}] Rolling: {parameters[1]}");
          return;
        case "close":
          if (!_dice.ContainsKey(parameters[1])) _dice.Add(parameters[1], 0);
          if (_dice[parameters[1]] != -1)
            UpdateDice(parameters[1], 0);
          Console.WriteLine($"[{ID}] Closing: {parameters[1]}");
          return;
        case "loadedroom":
          if (!_roomData.ContainsKey(parameters[1])) return;

          Send($"furni:{_roomData[parameters[1]]}");

          foreach (var item in _dice)
            Send($"update:{item.Key}:{item.Value}");

          Console.WriteLine($"[{ID}] Entered Room: {parameters[1]}");
          return;
        default:
          Console.WriteLine($"[{ID}] Unhandled Message: {e.Data}");
          return;
      }
    }

    private void RollDice(string id)
    {
      if (_dice[id] == -1) return;

      UpdateDice(id, -1);
      Task.Run(async () =>
      {
        await Task.Delay(1000);
        UpdateDice(id, _random.Next(1, 7));
      });
    }

    private void UpdateDice(string id, int value)
    {
      _dice[id] = value;
      Sessions.Broadcast($"update:{id}:{value}");
    }
  }
}